import React from "react";
import '../AditionalCss/navigation.css'
import { HStack } from '@chakra-ui/react'
import { BrowserRouter as Router, Switch, Route, Redirect } from "react-router-dom";

const NavigationMenu = () => {

    const handleClick = (anchor) => {
        const id = `${anchor}-section`;
        console.log(id)
        const element = document.getElementById(id);
        if (element) {
          element.scrollIntoView({
            behavior: "smooth",
            block: "start",
          });
        }
      };

    return (
      <div className="section">
        <div className="maindiv">
          <img src="https://i.ibb.co/5TyTXRr/Logo.jpg" className="image" alt="logo"/>
            <Router>
              <Switch className="links" spacing="50">
                <a href="">Home</a>
                <a href="#about" onClick={() => handleClick("about")}>About</a>
                <a href="#menu" onClick={() => handleClick("menu")}>Menu</a>
                <a href="../BookingPage.js">Reservation</a>
                <a href="">Orger Online</a>
                <a href="">Login</a>
              </Switch>
            </Router>
        </div>
      </div>
    )
}

export default NavigationMenu;
